import React from 'react'

export default function Navbar() {
  return (
    <div>
      <div>
        <link className="navbar-brand" to="/"> Navbar </link>
        <link className="nav-link active" to="/">Home</link>
        <link className="nav-link" to="/about">About Us</link>
      </div>
    </div>
  )
}
